import React from 'react';
import ReactDOM from 'react-dom';


class Hello extends React.Component {
  render(){
    return <h1>Hello pinky and winky</h1>
  }
}


const el = <Hello />;
ReactDOM.render(
  el, document.getElementById('root')
);
